window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b> bestselling author Robert Dugoni’s thrilling series continues as Seattle homicide detective Tracy Crosswhite is plunged into a case of family secrets and murder…</b></p> <p><b>“Another outstanding novel from one of the best crime writers in the business.” --</b><b><i>Associated Press</i></b></p> <p>Called in to consult after a young woman disappears, Tracy Crosswhite has the uneasy feeling that this is no ordinary missing-persons case. When the body turns up in an abandoned well, Tracy’s suspicions are confirmed. Estranged from her family, the victim had balked at an arranged marriage and had planned to attend graduate school. But someone cut her dreams short.</p> <p>Solving the mystery behind the murder isn’t Tracy’s only challenge. The detective is keeping a secret of her own: she’s pregnant. And now her biggest fear seems to be coming true when a new detective arrives to replace her. Meanwhile, Tracy’s colleague Vic Fazzio is about to take a fall after his investigation into the murder of a local community activist turns violent and leaves an invaluable witness dead.</p> <p>Two careers are on the line. And when more deadly secrets emerge, jobs might not be the only things at risk.</p>"; 
